import React from "react";

const BookList = ({products}) => {
    return (
        <table className="table">
            <thead>
                <tr>
                    <th>CODIGO</th>
                    <th>NAME</th>
                    <th>PRECIO</th>
                    <th>FABRICADO</th>
                    <th>FECHA VENCIMIENTO</th>
                </tr>
            </thead>
            <tbody>
                {products.map(product => 
                  <tr key={product.codigo}>
                     <th>product.codigo</th>
                     <th>product.name</th>
                     <th>product.precio</th>
                     <th>product.fabricado</th>
                     <th>product.fecha_vencimiento</th>
                 </tr>
                )}
                

            </tbody>

        </table>
    );
}

export default BookList;
